// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

contract RabbitHole {
    struct Player {
        address player;
        uint256 fuel;
        uint256 speed;
    }

    uint256 numOfplayers = 2;

    mapping(uint256 => Player) private players;

    constructor() {
        players[0].fuel = 50;
        players[0].speed = 5;
        players[1].fuel = 50;
        players[1].speed = 6;
    }

    function setPlayerSpeed(uint256 speed) public {
        uint i = 0;
        for (i = 0; i < numOfplayers;i ++) {
            if (players[i].player == msg.sender) {
                break;
            }
        }
        players[i].fuel = 50;
        players[i].speed = speed;
        players[i].player = msg.sender;
        if (i == numOfplayers)
            numOfplayers++;
    }

    function getPlayer(uint256 index) public view returns(Player memory) {
        return players[index];
    }

    
    function getPlayers() public view returns(Player[] memory) {
        Player[] memory _players = new Player[](numOfplayers);
        for(uint i = 0;i < numOfplayers;i ++) {
            _players[i] = players[i];
        }
        return _players;
    }

    function getLatestPlayer() public view returns(Player memory) {
        return players[numOfplayers - 1];
    }

    function calculatePosition() public view {
        uint256 speed = 0;
        uint256 index = 0;
        for (uint256 i = 0;i < numOfplayers; i ++) {
            if (players[i].speed > speed) {
                speed = players[index].speed;
                index = i;
            }
        }
    }
}

